function adjustBackgroundHeight(){let e=document.querySelector(".contact-content-container"),t=document.querySelectorAll(".contact-background-container");if(e)for(let o=0;o<t.length;o++){let n=e.offsetHeight;t[o].style.height=`${n}px`}}window.onload=adjustBackgroundHeight,window.onresize=adjustBackgroundHeight,document.getElementById("contact-form").addEventListener("submit",function(e){e.preventDefault();var t=new FormData(this);fetch(this.action,{method:this.method,body:t,headers:{Accept:"application/json"}}).then(e=>{if(!e.ok)throw Error("Network response was not ok");return e.json()}).then(e=>{window.location.href=window.location.origin+"/success"}).catch(e=>{console.error("There was an error!",e),alert("An error occurred. Please try again.")})});